import React from 'react';
import CardList from './CardList';
import SearchBox from './SearchBox';
import { robots } from './robots';



class App extends React.Component {
      constructor() {
            this.state = {
                  robots: robots,
                  searchfield: ''
         }
      }
      render() {
            return (
                  <div className='tc'>
                  <h1>RoboFreinds</h1>  
                  <SearchBox />
                  <CardList robots={robots}/>
                  </div>
            );
      }
      
}

export default App;
